import React from "react";
import { Typography } from "@material-ui/core";

const Footer = () => {
  return (
    <div>
      <center>
        <Typography variant="h4" color="secondary">
          soy el futer
        </Typography>
      </center>
    </div>
  );
};

export default Footer;
